According to the International Energy Agency, around four percent of the world electricity supply comes from solar electric cells. Solar energy is abundantly available in South Asia and in Sub Saharan Africa that is not harnessed nowhere near its full potential. The conventional technologies that harness solar energy are solar thermal and solar electric cells. Solar electric cells have a low conversion efficiency compared to solar heating cells and other thermal based energy conversion methods, for example an IC engine. Despite having a recycling efficiency of around 95%, recycling of solar electric cells is currently an expensive process. RESORCS project aims to design, construct and test an off-grid renewable energy production technology with a novel high output Rankine engine, local waste and solar energy harnessed with a concentrated solar collector.

A concentrated solar collector can collect thermal energy efficiently and relatively cheaply. Collected thermal energy is used to propel a Rankine Cycle engine based rotary turbine generator to generate electricity. Thermal energy collected can be boosted using thermal energy produced with waste combustion and bio-gas generated using waste. This hybrid combination can produce high grade thermal energy that will also increase thermodynamic efficiency of the prime mover, in this case, the FeTu turbine. Thermal energy collected during day is stored in a thermal energy reservoir that can be regulated based on demand. Electricity generated can be used directly, fed to the grid or stored in a battery bank for night time use or during high demand. It can also be used to power sustainable clean transport systems such as electric cars. The system can be used either as a standalone application or a grid connected system. The system is suited for a cluster of households or a small-scale enterprise.

In summary, the project aims to:

design and optimise a concentrated solar collector system with environmentally friendly materials and technology for optimal efficiency;
develop a thermal energy storage system and a Organic Rankine Cycle engine based turbine generator which is suitable for the concentrated solar collector system;
design electricity generation and control system with the concentrated solar system Stirling engine generator with grid connectivity;
design and integrate a waste combustion system to boost energy;
prototype the combination system and test its performance in different modes of use; and
investigate the design and impact of the system, pre and post design and construction
